import React from 'react';
import {
  styContainer,
  styContainerDetail,
  styTitle,
  stySku,
  styPrice,
} from './style';

const List = ({ data }) => {
  return (
    <div className={styContainer}>
      <div>
        <div className={stySku}>SKU: {data.sku}</div>
        <div className={styTitle}>{data.name}</div>
      </div>

      <div className={styContainerDetail}>
        <div className={styPrice}>Cost Price : {data.costPrice}</div>
        <div className={styPrice}>Retail Price : {data.retailPrice}</div>
        <div className={styPrice}>QTY :{data.qty}</div>
      </div>
    </div>
  );
};

export default List;
